package ra.dev.model.dto;public class ContactDTO {    private Integer contactId;    private String address;    private String email;    private Integer phoneNumber;    private String website;    public Integer getContactId() {        return this.contactId;    }    public void setContactId(Integer contactId) {        this.contactId = contactId;    }    public String getAddress() {        return this.address;    }    public void setAddress(String address) {        this.address = address;    }    public String getEmail() {        return this.email;    }    public void setEmail(String email) {        this.email = email;    }    public Integer getPhoneNumber() {        return this.phoneNumber;    }    public void setPhoneNumber(Integer phoneNumber) {        this.phoneNumber = phoneNumber;    }    public String getWebsite() {        return this.website;    }    public void setWebsite(String website) {        this.website = website;    }}